import React from "react";
import { Link } from "react-router-dom";
import "./Home.css"; // Importing the CSS file

const Home = () => {
  return (
    <div className="home-container">
      <div className="home-box">
        <h1 className="home-title">Welcome to the Consultation App</h1>
        <p className="home-text">Easily connect with consultants for your academic and professional needs.</p>
        
        <div className="mt-4">
          <Link to="/login">
            <button className="home-button home-button-primary">Login</button>
          </Link>
          <Link to="/signup">
            <button className="home-button home-button-outline">Signup</button>
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
